  return(
    <Fragment>
      <ul className = 'movies'>
        {
          videos.map( art => <li className = 'classLi'><a href = ''><Movie artId = {art.id} video = {art.video_url} title = {art.name} description = {art.description}/></a></li>)
        }
      </ul>
    </Fragment>
  )
}
export default Movies;
